bigip_as3.test:

resource "bigip_as3" "test" {

    as3_json      = jsonencode(

        {

            action      = "deploy"

            class       = "AS3"

            declaration = {

                Sample_http_01 = {

                    A1    = {

                        class      = "Application"

                        jsessionid = {

                            class             = "Persist"

                            cookieMethod      = "hash"

                            cookieName        = "JSESSIONID"

                            persistenceMethod = "cookie"

                        }

                        service    = {

                            class              = "Service_HTTP"

                            persistenceMethods = [

                                {

                                    use = "jsessionid"

                                },

                            ]

                            pool               = "web_pool"

                            virtualAddresses   = [

                                "10.0.2.10",

                            ]

                        }

                        web_pool   = {

                            class    = "Pool"

                            members  = [

                                {

                                    serverAddresses = [

                                        "192.0.2.10",

                                        "192.0.2.11",

                                    ]

                                    servicePort     = 80

                                },

                            ]

                            monitors = [

                                "http",

                            ]

                        }

                    }

                    class = "Tenant"

                }

                class          = "ADC"

                id             = "UDP_DNS_Sample"

                label          = "UDP_DNS_Sample"

                remark         = "Sample of a UDP DNS Load Balancer Service"

                schemaVersion  = "3.0.0"

            }

            persist     = true

        }

    )

    id            = "Sample_http_01"

    tenant_filter = "Sample_http_01"

    tenant_list   = "Sample_http_01"

}

